     //move tokens from account to this contract\\r\\n        token.transferFrom(msg.sender, address(this), _amount);\\r\\n        // address addr = msg.sender;\\r\\n        // address payable wallet = address(uint160(addr));\\r\\n        //send the sender eth\\r\\n        msg.sender.transfer(ethAmount);\\r\\n        //send an event\\r\\n        emit TokensSold(msg.sender, address(token), _amount, rate);\\r\\n    }\\r\\n}","sourcePath":"C:\\\\Users\\\\surge\\\\Desktop\\\\dapp-projects\\\\swap-thang\\\\contracts\\\\SwapThang.sol","ast":{"absolutePath":"project:/contracts/SwapThang.sol","exportedSymbols":{"SwapThang":[178]},"id":179,"nodeType":"SourceUnit","nodes":[{"id":34,"literals":["solidity","^","0.5",".0"],"nodeType":"PragmaDirective","src":"0:23:1"},{"absolutePath":"project:/contracts/Token.sol","file":"./Token.sol","id":35,"nodeType":"ImportDirective","scope":179,"sourceUnit":411,"src":"27:21:1","symbolAliases":[],"unitAlias":""},{"baseContracts":[],"contractDependencies":[],"contractKind":"contract","documentation":null,"fullyImplemented":true,"id":178,"linearizedBaseContracts":[178],"name":"SwapThang","nodeType":"ContractDefinition","nodes":[{"constant":false,"id":38,"name":"name","nodeType":"VariableDeclaration","scope":178,"src":"78:63:1","stateVariable":true,"storageLocation":"default","typeDescriptions":{"typeIdentifier":"t_string_storage","typeString":"string"},"typeName":{"id":36,"name":"string","nodeType":"ElementaryTypeName","src":"78:6:1","typeDescriptions":{"typeIdentifier":"t_string_storage_ptr","typeString":"string"}},"value":{"argumentTypes":null,"hexValue":"537761705468616e67202d2053656e642c2057697468647261772c20416e64205075726368617365","id":37,"isConstant":false,"isLValue":false,"isPure":true,"kind":"string","lValueRequested":false,"nodeType":"Literal","src":"99:42:1","subdenomination":null,"typeDescriptions":{"typeIdentifier":"t_stringliteral_f782579a9bbfaf0e9ac94edf703ecb1c75c334a8df549d5aafb941a7206f3ace","typeString":"literal_string \\"Sw